import React from "react";
import "./ProductsScreen.scss";

function ProductsScreen() {
  return (
    <div className="productsScreen">
      <div className="productScreen-container">
        <h1>Products Screen</h1>
      </div>
    </div>
  );
}

export default ProductsScreen;
